        messageAccepted = true;
    });
    var pingTimer = setInterval(function () {
        ws.send(pingMessage);
    }, pingInterval);
    var timeoutTimer = setInterval(function () {
        if (!messageAccepted) {
            ws.close();
        }
        else {
            messageAccepted = false;
        }
    }, pingTimeout);
